    false,nt"url": null,nt"notes": "The Anza Borrego Desert State Park (ABDSP)
    Vegetation Map depicts vegetation within the Park and its surrounding environment.
    The map was prepared by the Department of Fish and Game (DFG) under contract to
    the Department of Parks and Recreation (DPR) to assist DPR with preparation of a
    General Plan for ABDSP. The vegetation map was prepared using aerial photographs,
    field investigation, vegetation classification, and GIS processing and provides
    information on the location and extent of 94 vegetation types in the project area.
    The primary vegetation classification used for the project is based on A Manual
    of California Vegetation (Sawyer and Keeler-Wolf 1995). The data and classification
    work arising from this project will be used to refine future editions of the Manual.
    The vegetation map references other vegetation classifications as well.",nt"license_title":
